const s =
  '';
const t =
  '';

var findTheDifference = function (s, t) {
  let sSort = s.split('');
  let tSort = t.split('');
  let sSet = {};
  let tSet = {};

  for (let i = 0; i < sSort.length; i++) {
    if (sSet[sSort[i]]) {
      sSet[sSort[i]]++;
    } else {
      sSet[sSort[i]] = 1;
    }
  }

  for (let i = 0; i < tSort.length; i++) {
    if (tSet[tSort[i]]) {
      tSet[tSort[i]]++;
    } else {
      tSet[tSort[i]] = 1;
    }
  }

  let result;
  for (const key in tSet) {
    if (tSet[key] !== sSet[key]) {
      result = key;
    }
  }
  return result;
};

let result = findTheDifference(s, t);
console.log(result);
